    false,nt"url": null,nt"notes": "This shapefile is the final vegetation
    map of Sagamore Hill National Historic Site that provides local names for vegetation
    types, as well as crosswalks to the National Vegetation Classification System (NVCS),
    including association, alliance and formation level attributes. Crosswalks to the
    NVCS were determined on 29 June 2007. This data set was created using field data
    that were collected to assess thematic accuracy of the preliminary vegetation map
    (cross-referenced below). Therefore, although estimated thematic accuracy of the
    preliminary vegetation map is known, thematic accuracy of this data set is untested.",nt"license_title":
